import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import { Password } from 'primereact/password';
import { TabMenu } from 'primereact/tabmenu';
import { Menubar } from 'primereact/menubar';
import { StyleClass } from 'primereact/styleclass';
import './Css/Login.css';

const LoginPage = () => {
    const [activeIndex, setActiveIndex] = useState(0);
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const menuItems = [
        { label: 'Home' },
        { label: 'Our products' },
        { label: 'About US' },
        { label: 'Contact US' }
    ];

    const tabItems = [
        {label: 'Login', icon: 'pi pi-fw pi-sign-in'},
        {label: 'Sign up', icon: 'pi pi-fw pi-user-plus'}
    ];

    const start = <i className="pi pi-hospital text-2xl" style={{ color: 'var(--primary-color)' }}></i>;
    const end = <Button label="Join" severity="primary" />;

    return (
        <div className="login-page">
            <div className="navbar">
                <Menubar 
                    model={menuItems} 
                    start={start} 
                    end={end}
                    className="navbar-custom"
                />
            </div>

            <div className="flex-container">
                <div className="form-section">
                    <Card className="login-card">
                        <TabMenu 
                            model={tabItems} 
                            activeIndex={activeIndex} 
                            onTabChange={(e) => setActiveIndex(e.index)}
                            className="login-tabs"
                        />
                        
                        <div className="form-content">
                            <span className="p-input-icon-left w-full">
                                <i className="pi pi-envelope" />
                                <InputText
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    placeholder="Email or phone number"
                                    className="w-full"
                                />
                            </span>

                            <Password
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                placeholder="Password"
                                toggleMask
                                className="w-full"
                                inputClassName="w-full"
                                feedback={false}
                            />

                            <div className="flex-between">
                                <a className="forgot-link">Forgot your password?</a>
                            </div>

                            <Button 
                                label="Login" 
                                severity="primary"
                                className="w-full"
                            />
                        </div>
                    </Card>
                </div>

                <div className="illustration-section">
                    <div className="illustration">
                        <i className="pi pi-desktop" style={{ fontSize: '8rem', color: 'var(--primary-color)' }}></i>
                        <i className="pi pi-heart" style={{ fontSize: '2rem', color: 'var(--primary-color-light)' }}></i>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LoginPage;
